asset asset_get(const char *file) {
    asset res = asset_tryget(file);
    if(!res.data)
        raise(SIGABRT);
    return res;
}

asset asset_tryget(const char *file) {
    static bool loaded = false;
    if (!loaded) {
        loaded = true;
        map_init();
    }

    asset res = {NULL, 0};
    llist *item = map_get(file);
    if (item)
        res = item->value;
    return res;
}
